// of the page.

import React from 'react'
import ReactDOM from 'react-dom'
import Header from './header';
import Body from './body';


function App() {
  return (
    <div className="app">
      <Header />

    </div>
  );
}

function App1(){
  return(
    <div className='app1'>

    <Body data={value} />

    </div>
  )
}


document.addEventListener('DOMContentLoaded', () => {
  ReactDOM.render(
    <App/>,
    document.getElementById('content'),
  )
})

